ISLAMABAD, Dec 22 (APP): At least three people, including two women, were killed and several others were seriously injured in a cars collision near Babu Sabu Toll Plaza in Lahore on Wednesday.
According to details, rescue sources said that three cars piled up due to thick fog in the morning, and three people were killed on the spot, a private news channel reported.The rescue team and police reached the spot and shifted the injured to Jinnah hospital.
